import './App.css';
import TextField from "@mui/material/TextField";

function App() {
  return (
    <div className="App">
      <br/>
      <TextField
            type="email"
            label="email"
            variant="outlined"
            className="kush"
            // style={{ marginTop: "35px" }}
            placeholder='EmailId'
          />
          <br/>
          <br/>
          <TextField
            type="number"
            label="Mobile"
            variant="outlined"
            className="kush"
            // style={{ marginTop: "35px" }}
            placeholder='Mobile No'
          />
          <br/>
          <br/>
          <TextField
            type="text"
            label="Password"
            variant="outlined"
            className="kush"
            // style={{ marginTop: "35px" }}
            placeholder='Password'
          />
          <br/>
          <br/>
          <button type='button' sx={{p}}>
            Submit
          </button>
    </div>
  );
}

export default App;
